const userDelete = (props) => {
  console.log(props);
  var requestOptions = {
    method: "DELETE",
  };
  fetch(APIDELETE + idUser + "", requestOptions)
    .then((response) => response.json())
    .catch((error) => console.log("error", error));
};

export default userDelete;
